import React from "react";
import { createBrowserRouter, RouterProvider } from "react-router-dom";

// Components
import NavigationBar from "./NavigationBar";
import Home from "./Home";
import Services from "./Services";
import About from "./About";
import Contact from "./Contact";

// ✅ Layout wrapper that always shows NavigationBar
const Layout = () => {
  return (
    <div>
      <NavigationBar />
      <div style={{ padding: "20px" }}>
        <Outlet /> {/* All routed pages will render here */}
      </div>
    </div>
  );
};

// ✅ Define all routes using the modern API
const router = createBrowserRouter([
  {
    path: "/", // Root layout
    element: <Layout />,
    children: [
      { index: true, element: <Home /> }, // Default route "/"
      { path: "services", element: <Services /> },
      { path: "about", element: <About /> },
      { path: "contact", element: <Contact /> },
      { path: "*", element: <h2>404 - Page Not Found</h2> }, // fallback
    ],
  },
]);

// ✅ Main component providing the router
export default function MainComponent() {
  return <RouterProvider router={router} />;
}
